import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import {getAllStudents} from './client';

class App extends Component{
  render(){
    getAllStudents().then(res => res.json().then(students => {
      console.log(students);
    }));
    return <h1>HELLO</h1>
  }


}

export default App;
